import { Swiper, SwiperSlide } from "swiper/react";
import { Pagination, Navigation } from "swiper";

import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./slider.css";


const swiperSlide = ({id,image, descripton, resume}) =>(
    <button id={id}>
            <img src={image} alt={resume} />
            <p className='Description'>{descripton}</p>
    </button>
)

const Slider = () =>{ 
return (
    <>
    <Swiper
        slidesPerView={3}
        spaceBetween={30}
        slidesPerGroup={3}
        loop={true}
        loopFillGroupWithBlank={true}
        pagination={{
        clickable: true,
        }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
    >

        <swiperSlide
            mage="chrome://branding/content/about-logo.png"
            resume="tnarunatru"
            descripton=''
        />
        {/* <Card
                image="chrome://branding/content/about-logo.png"
                resume="tnarunatru"
                descripton=''
            /> */}

        <button>
            <SwiperSlide>
            <img src="chrome://branding/content/about-logo.png" alt="" />
            <p className='Description'>enturaontur</p>
            </SwiperSlide>
        </button>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
    </Swiper>
    </>
)
}
export default Slider
